Приложение Yapona Mama– это самый удобный и быстрый способ заказать вкуснейшие суши! Устанавливайте приложение Yapona Mama и получайте онлайн-доступ к нашему сервису доставки в любое время и в любом месте. 

Заказывайте доставку суши, пиццы на дом или берите с собой, посетив наши заведения. Просматривайте подробное меню с описаниями ингредиентов каждого блюда и прекрасными фото, читайте страницы Yapona Mama в социальных сетях и делитесь ими с друзьями.

Используя наше приложение, Вы можете:
- самостоятельно сформировать и оплатить заказ;
- выбрать удобный для Вас способ оплаты;
- установить время, в которое Вы бы хотели забрать заказ из нашего заведения; 
- установить время доставки заказа на дом;

Используя мобильное приложение Yapona Mama, Вы с легкостью можете заказать суши, пиццу, wok, салаты на любой вкус.  Доступные в приложении подробные описания и качественные фотографии блюд помогут Вам выбрать именно то, что Вы хотите.

Приложение Красное&Белое — одна маленькая иконка, а столько полезных функций! Регистрируйся в удобном личном кабинете и ты сможешь:

• Узнать стоимость любого товара;
• Узнать об акциях и скидках;
• Определить местонахождение ближайшего магазина;
• Найти нужный товар, ознакомиться с его описанием и рейтингом;
• Проверить напитки на легальность по коду в чеке;
• Привязать дисконтную карту к смартфону и получать скидку;

Мобильное приложение Красное&Белое носит информационный характер. Предназначено только для предоставления сведений о наличии товаров в магазинах и их бронировании, не предусматривает возможности покупки и доставки товаров. Предназначено для лиц, достигших 18-летнего возраста.

Квартира убрана, носки сложены по ящикам, хрусталь бабушки надёжно спрятан – похоже, у тебя намечается вечеринка! 

Кого ты сегодня ждёшь к себе? Свою вторую половинку, друзей, родственников из Урюпинска? Неважно, кто посетит твою скромную обитель. Важно, чем он будет впечатлён! А гость, поверь, будет сражён наповал твоими незабываемо вкусными коктейлями.

С приложением «Синий Я» ты станешь мастером коктеледеланья. Удивишь всех, оставишь их в недоумении и с вопросом лишь об одном: «где также научится делать эти напитки Богов?»

А ответ ведь прост – с помощью «Синий Я»!

«Синий Я» - это:

- Подбор коктейля из твоих ингридиентов;
- Множество рецептов;
- Истории коктейлей;
- Удобный личный бар;
- Список покупок;
- Продуманные фильтры;
- Приятный дизайн;
- Отличное юзабилити.

Вы станете участником клуба атмосферных напитков WINE&SPIRITS и получите возможность пользоваться постоянной скидкой на сопутствующие товары, а также накапливать бонусные баллы.
Готовитесь к празднику, и ищете напиток, способный удивить гостей? А может решили провести вечер дома, и хотите дополнить атмосферу любимым вином? В сети WINE&SPIRITS вы найдете то, что нужно, а каждый визит в наши магазины с новым приложением будет еще приятнее. Достаточно показать кассиру QR-код и можно оплатить бонусными баллами до 50% стоимости сопутствующих товаров и получить скидку.
С приложением вы будете получать бонусные баллы за каждую покупку в наших магазинах, за приглашение друзей в клуб WINE&SPIRITS, а также за прохождение обучающих тестов и опросов.
Приложение позволяет:
●	накапливать бонусные баллы, чтобы получать дополнительную выгоду;
●	увеличивать размер скидки в зависимости от ваших покупок;
●	получать доступ к авторским материалам от сомелье и узнавать больше о любимых напитках;
●	проходить обучающие тесты, чтобы проверить свои знания о вине, крепких напитках и коктейлях;
●	находить ближайший к вам магазин WINE&SPIRITS и стоить к нему удобный маршрут;
●	делиться мнением о любимых напитках и рассказывать нам о своих предпочтениях;
●	первыми узнавать новости о предстоящих акциях, мероприятиях и дегустациях.
